import React  from 'react'
import ListData from '../data/clients1.json'
import ListDetails from './ListDetails'

class List extends React.Component {
	listItemClicked(event){
		alert(clientsInfo)
	}
	render() {
		return(
			<div className="box-content">
				{
					ListData.map((item ,clientsInfo ,index)=>{


					return <ListDetails list={item} key = {clientsInfo} />
				})}
			</div>
		);
	}
}
export default List
